import React from 'react';

function Login() {
  return (
    <>
        <h1>Логин</h1>
        <input id='login' type='text' placeholder='Логин'></input>
        <input id='password' type='password' placeholder='Пароль'></input>
        <button>Войти</button>
    </>
  );
}

export default Login;
